import React from 'react';

const Home = () => {
  return (
    <div className="ui row">
      <BrowserRouter>
        <div className="column eight wide">
          <Header />
        </div>

        <div className="column eight wide">
          <Route path="/" exact component={Home}/>
          <Route path="/Transaction" component={Transaction}/>
          <Route path="/Transfer" component={Transfer}/>
        </div>
      </BrowserRouter>
    </div>
  );
};

export default Home;
